import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
const CustomPage = () => {
  const [basketBox, setBasketBox] = useState([]);

  useEffect(() => {
    fetch(`${process.env.PUBLIC_URL}/data/basket.json`)
      .then((response) => response.json())
      .then((data) => setBasketBox(data))
      .catch(() => console.log("basket not find"));
  }, []);

  return (
    <>
      <section>
        <div>
          <div>
            <h2>Створи свою неповторну чашку!</h2>
            <p>
              Хочеш подарувати незабутні емоції для своїх рідних і близьких?
              Кастомізуй чашку, додай <br /> свій текст та картинки, які хочеш
              нанести на чашку. Кращого подарунку просто не існує!
            </p>
            <button>зробити свою чашку</button>
          </div>
        </div>
      </section>
      <section>
        <div>
          <h2>Як замовити кастомну чашку зі своїм дизайном?</h2>
          <article>
            <h3>Завантажити фото</h3>
            <p>Завантажте фото або картинку, яку хочете нанести на чашку.</p>
          </article>
        </div>
      </section>
      <form>
        <h2>Створи свою унікальну чашку!</h2>
        <article>
          <h3>Тип чашки:</h3>
          <div>
            {basketBox.map((element: any, index: any) => {
              return (
                <article key={index}>
                  <input
                    key={index}
                    id={`${element.name} ${index}`}
                    className="drawer__box-checkbox"
                    type="radio"
                    name="RADIOBOXS"
                  />
                  <label
                    // onClick={() => setBoxsPriceBasket(element.price)}
                    key={index}
                    htmlFor={`${element.name} ${index}`}
                    className="drawer__box"
                  >
                    <img
                      src={`${process.env.PUBLIC_URL}/img/${element.img}`}
                      className="drawer__box-img"
                    />
                    <h5 className="drawer__box-title">{element.name}</h5>
                  </label>
                </article>
              );
            })}
          </div>
        </article>
        <article>
          <h3>Текст:</h3>
          <input
            className="drawer__input"
            name="text"
            style={
              {
                // borderColor: fullName.isValid ? "#444ad3" : "red",
              }
            }
            type="text"
            placeholder="Введіть текст який потрібно нанести на чашку"
          />
        </article>
        <article>
          <h3>Завантажте фото:</h3>
          <p>Завантажте фото яке потрібно нанести на чашку</p>
          <input type="file" name="photo" />
          <button>заватажити фото</button>
        </article>
        <article>
          <h3>Ваш номер телефону:</h3>
          <input
            className="drawer__input"
            type="text"
            name="phoneNumber"
            //   value={inputData.phoneNumber.value}
            maxLength={13}
            //   onChange={onChangeInput}
            placeholder="+38 (___) ___-__-__"
          />
        </article>
        <article>
          <h3>Коментар:</h3>
          <input
            className="drawer__input"
            type="text"
            name="comment"
            //   value={inputData.phoneNumber.value}
            //   onChange={onChangeInput}
            placeholder="Залиште коментар до свого замовлення"
          />
        </article>
        <article>
          <h3>Додай бокс для вау ефекту! ✨</h3>
          <div>
            {basketBox.map((element: any, index: any) => {
              return (
                <article key={index}>
                  <input
                    key={index}
                    id={`${element.name} ${index}`}
                    className="drawer__box-checkbox"
                    type="radio"
                    name="RADIOBOXS"
                  />
                  <label
                    // onClick={() => setBoxsPriceBasket(element.price)}
                    key={index}
                    htmlFor={`${element.name} ${index}`}
                    className="drawer__box"
                  >
                    <img
                      src={`${process.env.PUBLIC_URL}/img/${element.img}`}
                      className="drawer__box-img"
                    />
                    <h5 className="drawer__box-title">{element.name}</h5>
                  </label>
                </article>
              );
            })}
          </div>
        </article>
        <button type="submit">Дізнатись ціну</button>
        <footer>
          Натискаючи кнопку, ви погоджуєтесь з{" "}
          <Link to={""}>Політикою конфіденційності</Link> та{" "}
          <Link to={""}>Договором публічної оферти</Link>
        </footer>
      </form>
    </>
  );
};
export default CustomPage;
